import { NavLink } from "react-router-dom";
import "../Style/botones.css"
const Botones = () => {
    return (
        <header id="Menu">
            <NavLink to="/Lista" 
            className={({ isActive, isPending }) =>
            isPending ? "link" : isActive ? "active" : ""
        }>
                <button id="boton">List View</button>
            </NavLink>
            <NavLink to="/Busqueda" >
                <button id="boton">Search</button>
            </NavLink>
            <NavLink to="/" >
                <button id="botonClose">CLOSE</button>
            </NavLink>
        </header>
    );
}

export default Botones;
